    mapping(address => Ticket) tickets; //user's tickets
    bool active; //true if a round is active, false otherwise
    uint ticket_price = 10;

    constructor() {
       active = true;
    }

    function startNewRound() public{
        if(active == false)
            active = true;
    }

    function buy(uint _numbers, uint _powerball) public payable returns(bool){

        require(active == true, "Lottery closed");

        //check if the numbers are ok

        //create an istance of ticket type
        //TODO: passare la lista come parametro
        Ticket memory ticket = Ticket({numbers : _numbers, powerball : _powerball});
        tickets[msg.sender] = ticket;

        uint money = msg.value;

        require(money >= ticket_price, "Value too small");

        //add the ticket into dataset

        if(money > ticket_price)
            payable(msg.sender).transfer(msg.value - ticket_price);

        return true;
    }

